import React from 'react';

function DisplayCard({ name, value }) {
  return (
    <div className="bg-white p-4 shadow rounded">
      <h2 className="text-lg font-semibold">{name}</h2>
      <p className="text-gray-600">{value}</p>
    </div>
  );
}

export default DisplayCard;
